import React from "react";
import { Grid, Paper, Typography, Box, Avatar, Divider, Container } from "@mui/material";
import { styled } from "@mui/system";
import theme from "../styles/theme"; 
import barbellIcon from "../Images/Login/23603572.png"; 
import ProgressBar from "../components/ProgressBar"; 
import WaterIntake from "../components/WaterIntake"; 

const MainContent = styled(Container)({
  padding: theme.spacing(3),
  backgroundColor: theme.palette.background.default,
  maxWidth: '1400px', 
  margin: 'auto',
});

const ContentPaper = styled(Paper)({
  padding: theme.spacing(3),
  backgroundColor: theme.palette.background.paper,
  borderRadius: theme.shape.borderRadius,
});

const SquarePaper = styled(Paper)({
  width: '200px',
  height: '200px',
  padding: theme.spacing(2),
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  backgroundColor: theme.palette.background.paper,
  borderRadius: theme.shape.borderRadius,
});

const RectanglePaper = styled(Paper)({
  width: '420px', 
  height: '200px', 
  padding: theme.spacing(3),
  backgroundColor: theme.palette.background.paper,
  borderRadius: theme.shape.borderRadius,
});

const SidebarPaper = styled(Paper)({
  width: '230px', // Slightly reduced width of the sidebar
  padding: theme.spacing(3),
  backgroundColor: theme.palette.background.paper,
  borderRadius: theme.shape.borderRadius,
});

const HomePage = () => {
  const monthlyProgress = 80;

  return (
    <MainContent>
      <Grid container spacing={2}> 
        <Grid item xs={12}>
          <Box display="flex" alignItems="center" mb={2}>
            <img src={barbellIcon} alt="Bulking Sensei" width="80" height="40" style={{ marginRight: theme.spacing(1) }} />
            <Typography variant="h6" sx={{ fontFamily: "Nanum Gothic, sans-serif" }}>
              Bulking Sensei
            </Typography>
          </Box>
        </Grid>

        {/* Main Content */}
        <Grid item xs={9}> {/* Main Content Area */}
          <Typography variant="h4" sx={{ mb: 3 }}>
            Welcome Back!
          </Typography>
          <Grid container spacing={3}>
            <Grid item xs={9}>
              <RectanglePaper elevation={3}>
                <Typography variant="h6">Steps</Typography>
                <Typography variant="h4">2,500 Steps</Typography>
                <Typography variant="body2">50% of your goals</Typography>
              </RectanglePaper>
            </Grid>

            {/* Water and Future Feature Boxes Side by Side */}


            <Grid item xs={12} sm={6}>
              <ContentPaper elevation={3}>
                <Typography variant="h6">Activity</Typography>
                {/* Add Activity chart here */}
              </ContentPaper>
            </Grid>
            <Grid item xs={12} sm={6}>
              <ContentPaper elevation={3}>
                <Typography variant="h6">Progress</Typography>
                {/* Add Progress chart here */}
              </ContentPaper>
            </Grid>
          </Grid>
        </Grid>

        {/* User Profile and Goals */}
        <Grid item xs={3}> {/* Sidebar Area */}
          <SidebarPaper elevation={3}>
            <Avatar
              alt="Thomas Fletcher"
              src="/path/to/avatar.png"
              sx={{ width: 56, height: 56, mb: 2 }}
            />
            <Typography variant="h6">Thomas Fletcher</Typography>
            <Typography variant="body2">Sydney, Australia</Typography>
            <Divider sx={{ my: 2 }} />
            <Typography variant="h6">Your Goals</Typography>
            <Typography variant="body2">Running: 70km/80km</Typography>
            <Typography variant="body2">Weight Loss: 70kg/100kg</Typography>
            <Divider sx={{ my: 2 }} />
            <Typography variant="h6">Monthly Progress</Typography>
            <ProgressBar value={monthlyProgress} />
            <Divider sx={{ my: 2 }} />
            <Typography variant="h6">Scheduled</Typography>
            <Typography variant="body2">Training - Yoga Class</Typography>
            <Typography variant="body2">22 Mar</Typography>
            <Typography variant="body2">Training - Swimming</Typography>
            <Typography variant="body2">22 Mar</Typography>
          </SidebarPaper>
        </Grid>
      </Grid>
    </MainContent>
  );
};

export default HomePage;
